import React from 'react';
import './App.css';
import LoginForm from './LoginForm';
import RegistrationForm from './RegistrationForm';
import ManagementPage from './pages/ManagementPage';

function App() {
  return (
    <div className="App">
      <h1>Minha Aplicação</h1>
      <LoginForm />
      <RegistrationForm />
      <ManagementPage />
    </div>
  );
}

export default App;
